It was another fast stage and the team focused on making sure Wilco was always in a good position and protected in case of echelons and splits in the peloton. In the closing kilometers I was in the front but in the final approach, before the last turn, I was a bit further back, not in an ideal position. As a result, I wasn't able to launch my sprint when I would have liked. My knee is getting better and I'll keep fighting.

Bola to ďalšia rýchla etapa a náš tím sa zameral na to aby sme Wilca udržali v dobrej pozícii a ochránili ho v prípade bočného vetra a delenia pelotónu. V záverečných kilometroch som bol vpredu, ale vo finále, tesne pred poslednou zákrutou som sa ocitol o niečo ďalej vzadu na nie úplne ideálnej pozícii.  Výsledkom bolo, že keď som chcel začať špurtovať, tak som vlastne ani nemal priestor. Koleno sa mi zlepšuje a samozrejme budem bojovať ďalej.

